import React from 'react'
// import { NavLink } from 'react-router-dom'
// import SearchBar from 'material-ui-search-bar'
// import ReactSearchBox from 'react-search-box'
import SearchField from "react-search-field";
import './styles/Nav.css'

const authenticatedNav = (
    <div className="row sign-out">
      <NavLink className="nav" to="/sign-out">
        Sign Out
      </NavLink>
    </div>
  );

  const unauthenticatedNav = (
    <div className="nav unauth">
      <div className="nav-signin row">
        <NavLink className="nav" activeClassName="active" to="/sign-in">
          Log In
        </NavLink>
        <NavLink className="nav" activeClassName="active" to="/sign-up">
          Sign Up
        </NavLink>
      </div>
    </div>
  );





export const Nav = (props) => {
    return (
        <div className='nav-container'>
            <div className='nav'>
                <img className='logo' src='https://i.imgur.com/IiKnuHJ.png'></img>
                <SearchField
                    // placeholder="Search..."
                    // onChange = {onChange}
                    classNames="searchBar"
                />
                <h1 className='Games'> Games </h1>
            </div>
        </div>
    )
}


export default Nav
